import React from 'react';
import { Row, Col } from 'react-bootstrap';

function TalentItem({ talent }) {
  return (
    <Row className="mt-2">
      <Col>{talent.name}</Col>
      <Col>{talent.contractDuration}</Col>
      <Col>{talent.billRate}</Col>
      <Col>{talent.currency}</Col>
      {/* Render other fields such as Standard Time BR, Over Time BR, etc. */}
    </Row>
  );
}

export default TalentItem;
